import React from 'react'

export default function Layout(content) {
  return (
    <div>
        <h1>Esto es le hearder</h1>
        <div className='row'>
          <div className='col'>
            esto es el menu
          </div>
          <div className='col'>
            {content.children}
          </div>
        </div>
    </div>
  )
}
